                <img src={Image1} alt="" />
            </div>
            <div class="right">
                <h1>HELLO!</h1>
                <h2>I'm Akhmad Firdaus,</h2>
                <h2>a Web Developer.</h2>
                <div class="lightbtn">
                    <button class="button-nav"><Link to='/profile'>PROFILE</Link></button>
                    <button class="button-nav"><Link to='/idea'>IDEA</Link></button>
